This release:
- fixes minor bugs detecting a wildcard `case` within a `match`. Thanks to @nedbat for pointing it out;
- improving handling for when, after a `fork`, the child process closes the coverage file descriptor;

This release:

- adds support for Python 3.13 (tested on 3.13.0a6; may not work on earlier versions);
- improves `pytest-fork` detection;

Thanks to @adiroiban for the early work on Python 3.13 support;

This release:
- improves performance handling subprocesses (Unix only);
- fixes a bug reporting subprocess data merge errors if tests close stderr;
- fixes a bug not passing the script name as a string in sys.argv[0] when executing a script directly;
- fixes a bug attempting to print coverage when none was collected;

This release:
- adds [pytest-forked](https://github.com/pytest-dev/pytest-forked) support on Unix/MacOS;
- makes file matching more reliable and fixes bugs around matching relative paths;

Thanks to @peterjc  and @P403n1x87 for their contributions!

This release:
- adds a "show_contexts" field to the JSON coverage output, improving compatibility with `coverage.py` and codecov;
- works around a rare issue reading source code when it contains non-ASCII characters;

Thank you, @guillaumeLepape, for figuring out the Codecov issue and providing a fix.

This release:
- adds `--version` to the command flags, to display SlipCover's version and exit;
- adds scanning for files never executed in the directories passed with `--source`, so that these, too, are included in the output;
- adds a summary line to the text version of the coverage results;
- fixes bugs computing the destination of certain branches when they occur within a `try` (including `except`, `except*`, `try`-`else` and `finally`). This affects only the branch destination shown, not their existence, counting, or statistics.

This release:

- adds Python 3.12 support, based on the new PEP669 (sys.monitoring) API, rather than bytecode rewriting;
- under Python 3.12, limits support for branch coverage to source files with less than ~32k lines. This is to facilitate adopting PEP669;
- changes the version number to 1.0.1, as this project is now (far) beyond being experimental.

This release:
- fixes a bug instrumenting for branch coverage. The bug was leading to crashes during de-instrumentation on PyPy;
- continues the work towards making Slipcover more useful for guiding fuzzing;

Many thanks to @cfbolz for figuring this bug out, including an [MRE](https://en.wikipedia.org/wiki/Minimal_reproducible_example) for it!

This release:
- adds `--skip-covered` to skip fully (100%) covered files when printing coverage, suggested by @LilyFoote;
- adds `--fail-under T` to have Slicover fail with a return code of 2 if the overall coverage is less than `T`, suggested by @rec;
- fixes a division by 0 when printing out coverage for empty files on Python 3.11; thank you, @diceroll123!

This release:
- fixes failing tests with Python 3.11;
- adds wheels for Python 3.11;
- adds an experimental option, `--immediate`, which essentially implements on-stack replacement by ignoring Python's rule that code objects should be immutable. Using it further reduces overhead, as Slipcover need not generate new code objects or update references to it. Use at your own risk... this is really only intended for research purposes;
- fixes an include file, ironically, not being included into the source distribution;

This release:
- fixes a bug causing Slipcover to move functions' docstrings when doing branch coverage, so that they could no longer be found;
- advances version to 0.2.0 given the support for branch coverage;

This release:
- fixes a packaging issue omitting Python 3.11 from classifiers;
- acknowledges pypy support, contributed by @cfbolz, and actually added in v0.1.7;

This release:
- adds support for Python 3.11 (technically 3.11.0b3);
- changes missing lines text formatting to include any non-code lines between missing ones, simplifying output and aligning it with Coverage.py;

Changes in this release:
- fixed file filter not being used for modules loaded through `pytest`, including uninteresting coverage results;
- simplified statistics gathering, also greatly improving its performance;

Changes in release:
- fixed `pytest` plugins not being loaded, due to a conflict between how Slipcover was manipulating `sys.meta_path` and `importlib.metadata`'s package detection. Note that some plugins may not yet work (notably, `pytest-xdist`) -- see #9.
- added handler for `MetaPathFinder`s that don't implement `find_spec`;

Changes in this release:
- Fixed tracker module not always loading with Python 3.8 on Windows, due to Microsoft Studio dependencies;
- Fixed description links on pypi;
- Improved Python library path detection (still needs work, though);
- Fixed missing wheels for Python 3.9 and 3.10;

Changes:
- Slipcover now interposes on pytest, so that you can get coverage results on those files as well;
- Fixed function finder not finding static and class methods (affected performance, not correctness);
